import React from 'react';
import { useAuth } from '../context/AuthContext';
import './Header.css';

function Header({ 
  activeView, 
  setActiveView, 
  useCases, 
  selectedUseCase, 
  onUseCaseChange,
  selectedPeriod,
  onPeriodChange,
  periodOptions,
  lastUpdated,
  hasData,
  onSendReport
}) {
  const { user, logout, isDevMode } = useAuth();

  const navItems = [
    { id: 'overview', label: 'Overview' },
    { id: 'analysis', label: 'Analysis' }
  ];

  if (isDevMode()) {
    navItems.push({ id: 'upload', label: 'Upload' });
  }

  const handleLogoError = (e) => {
    // Hide the image and show fallback
    e.target.style.display = 'none';
    const fallback = e.target.nextElementSibling;
    if (fallback) {
      fallback.style.display = 'flex';
    }
  };

  return (
    <header className="header">
      <div className="header-inner">
        <div className="header-left">
          <div className="header-brand">
            <div className="brand-mark">
              {/* Primary Logo Image */}
              <img 
                src="/THD.png" 
                alt="The Home Depot" 
                className="brand-logo-img"
                onError={handleLogoError}
              />
              {/* Fallback SVG Logo (hidden by default) */}
              <div className="brand-logo-fallback" style={{ display: 'none' }}>
                <svg viewBox="0 0 32 32" fill="none" xmlns="http://www.w3.org/2000/svg">
                  <rect width="32" height="32" rx="7" fill="#F96302"/>
                  <rect x="7" y="8" width="6" height="16" rx="1.5" fill="white"/>
                  <rect x="19" y="8" width="6" height="16" rx="1.5" fill="white"/>
                  <rect x="7" y="13" width="18" height="6" rx="1.5" fill="white"/>
                </svg>
              </div>
            </div>
          </div>

          <nav className="header-nav">
            {navItems.map(item => (
              <button
                key={item.id}
                className={`nav-btn ${activeView === item.id ? 'active' : ''}`}
                onClick={() => setActiveView(item.id)}
              >
                {item.label}
              </button>
            ))}
          </nav>
        </div>

        <div className="header-right">
          {hasData && activeView !== 'upload' && (
            <>
              <div className="period-selector">
                {periodOptions.map(option => (
                  <button
                    key={option.value}
                    className={`period-btn ${selectedPeriod === option.value ? 'active' : ''}`}
                    onClick={() => onPeriodChange(option.value)}
                  >
                    {option.label}
                  </button>
                ))}
              </div>

              {useCases.length > 0 && (
                <div className="use-case-selector">
                  <select 
                    value={selectedUseCase} 
                    onChange={(e) => onUseCaseChange(e.target.value)}
                  >
                    {useCases.map(uc => (
                      <option key={uc} value={uc}>{uc}</option>
                    ))}
                  </select>
                </div>
              )}

              <button className="send-report-btn" onClick={onSendReport}>
                <svg width="16" height="16" viewBox="0 0 24 24" fill="none" stroke="currentColor" strokeWidth="2">
                  <line x1="22" y1="2" x2="11" y2="13"></line>
                  <polygon points="22 2 15 22 11 13 2 9 22 2"></polygon>
                </svg>
                <span>Send Report</span>
              </button>
            </>
          )}

          <div className="user-menu">
            <div className="user-avatar">
              {user?.name?.charAt(0) || 'U'}
            </div>
            <button className="logout-btn" onClick={logout} title="Sign out">
              <svg xmlns="http://www.w3.org/2000/svg" width="18" height="18" viewBox="0 0 24 24" fill="none" stroke="currentColor" strokeWidth="2" strokeLinecap="round" strokeLinejoin="round">
                <path d="M9 21H5a2 2 0 0 1-2-2V5a2 2 0 0 1 2-2h4"></path>
                <polyline points="16 17 21 12 16 7"></polyline>
                <line x1="21" y1="12" x2="9" y2="12"></line>
              </svg>
            </button>
          </div>
        </div>
      </div>
    </header>
  );
}

export default Header;
